import { Carousel } from 'antd';
import 'antd/dist/antd.css';
import pic1 from '../../123/1.JPG'

const contentStyle = {
    height: '160px',
    color: '#fff',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#123456',
};

class Header extends Component {
    render() { 
        return(
            <>
            <Carousel autoplay>
                <div>
                <h3><img src={pic1} alt="" />1</h3>
                </div>
                <div>
                <h3 style={contentStyle}>2</h3>
                </div>
                <div>
                <h3 style={contentStyle}>3</h3>
                </div>
                <div>
                <h3 style={contentStyle}>4</h3>
                </div>
            </Carousel>
            </>
        );
    }
}

export default Header;
